    drawParticles: function () {

        var PI2 = Math.PI*2;

        var material = new THREE.SpriteCanvasMaterial({
            color   :0x000000,
            program : function (context) { // program = shape you want this material to take
                context.beginPath();
                context.arc(0,0,1,0,PI2,true);
                context.fill();
            }
        });

        app.sphereGroup = new THREE.Group();

        for (var i = 0; i < app.sphereVerticesArray.length; i++) {


            var particle = new THREE.Sprite(material);

            //app.scene.remove(particle);

            particle.position.x = app.sphereVerticesArray[i].x + Math.random() * 4 - 2;
            particle.position.y = app.sphereVerticesArray[i].y + Math.random() * 4 - 2;
            particle.position.z = app.sphereVerticesArray[i].z;
            particle.scale.x = particle.scale.y = 0.2;
            app.sphereParticlesArray.push(particle);
            app.sphereGroup.add( particle );
            //app.scene.add(particle);

            TweenLite.to(particle.position, 10, { x:0, y:0, z:0, ease: Quad.easeInOut });

        }


        app.scene.add(app.sphereGroup);



    },
